
var frequencySort = function(s) {
    
    let mapNow = new Map();
    let arrNow = [];
    let ss = "";

    for(let i = 0; i <= s.length -1; i++){

        if(mapNow.has(s[i])){
            mapNow.set(s[i], mapNow.get(s[i]) + 1)
        } else {
            mapNow.set(s[i], 1);
        }

    };

    for(let now of mapNow.values()){
        arrNow.push(now);
    }

    arrNow = test(arrNow);

    function test(arr){

        return arr.sort( function(a,b) { return a - b; } )

    };

    for(let a = arrNow.length -1; a >= 0; a--){
        let keyNow = getByValue(mapNow, arrNow[a]);
        devString(keyNow, arrNow[a])
        mapNow.delete(keyNow);
    }

    function getByValue(map, searchValue){
        for (let [key, value] of map.entries()) {
            if (value === searchValue){
              return key
            }
        }
    }

    function devString(key, freq){
        for(let b = 0; b <= freq - 1; b++){
            ss += key;
        }
    }

    return ss;

};

let s = '""';

console.log(frequencySort(s));